import React from "react"
import { BrowserRouter as  Router, Route, Link } from 'react-router-dom';


class Listings extends React.Component {
  render () {
      const {listing} = this.props
      let list = listing.map(house => {
          return <li key={listing.id}>{list.location}{list.zip}{list.address}{list.buy}{list.rent}{list.price}
          <div>
            <Link to={`/listings/${list.id}`}>show details</Link>
          </div>
          </li>
      })

    return (
     <ul>
        {list}
     </ul>
    );
  }
}

export default Listings
